import React, { Component } from "react";
import { createStackNavigator } from "@react-navigation/stack";
import { NavigationContainer } from "@react-navigation/native";
import { HomeScreen, QuestScreen, NutritionalScreen, ShopScreen, SettingScreen } from "../screens/ScreenComponents";

const Stack = createStackNavigator();
//This is the main Navigator to navigate across different features component
export default class MainNavigator extends Component {
  render() {
    return (
      <NavigationContainer>
        <Stack.Navigator>
          <Stack.Screen
            name="Home"
            component={HomeScreen}
            options={{
              headerShown: false
            }}
          />
          <Stack.Screen
            name="Quest"
            component={QuestScreen}
            options={{
              headerShown: false
            }}
          />
          <Stack.Screen
            name="Nutritional"
            component={NutritionalScreen}
            options={{
              headerShown: false
            }}
          />
          <Stack.Screen
            name="Shop"
            component={ShopScreen}
            options={{
              headerShown: false
            }}
          />
          <Stack.Screen
            name="Settings"
            component={SettingScreen}
            options={{
              headerShown: false
            }}
          />
        </Stack.Navigator>
      </NavigationContainer>
    );
  }
}
